import logo from './logo.svg';
import './App.css';
import Navbar from './pages/Navbar';
import News from './pages/News';

import {
  BrowserRouter as Router,
  Route,
  Routes
} from "react-router-dom";

function App() {
  return (
    <div>
      <Router>

      <Navbar/>
      <Routes></Routes>

      <Route exact path='/business' element={<News setProgress={this.setProgress}    key="business" headtitle='Yoy see the Business news' pageSize={6} country='in' category="business" />} />
      </Router>
    </div>
  );
}

export default App;
